import React, { Component } from 'react';
import HomeContainer from '../src/components/home.js';
import {
    BrowserRouter as Router,
    Switch,
    Route
} from "react-router-dom";

class App extends Component {

    render() {
        return (
            <div className = "App">
                <header className = "App-header">
                    <Switch>
                    <HomeContainer/>
                    </Switch>
                </header>
            </div>
        );
    }
}
export default App;
